import React from 'react';

const MapComponent = ({ latitude, longitude }) => {
  const mapUrl = `https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d387729.9488450536!2d${longitude}!3d${latitude}!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8085809b6b3f7db1%3A0x4e5b8f3756e31f60!2sSan%20Francisco%2C%20CA!5e0!3m2!1sen!2sus!4v1576749230725!5m2!1sen!2sus`;

  return (
    <div style={{ width: '100%', height: '100%' }}>
      <iframe
        title="Google Map"
        width="100%"
        height="100%"
        frameBorder="0"
        style={{ border: 0 }}
        src={mapUrl}
        allowFullScreen
      ></iframe>
    </div>
  );
};

export default MapComponent;
